function footerAdj() {
	var footerH = $("footer").outerHeight();
	$("footer").css({ "margin-top": -footerH });
	$(".wrapper").css({ "padding-bottom": footerH });
}

function accordion() {
	$(".accordion-title").click(function() {
		$this = $(this).closest(".accordion-block");
		if ($this.hasClass("active")) {
			$this.removeClass("active");
			$this.find(".accordion-content").slideUp();
		} else {
			$this.siblings(".accordion-block").removeClass("active");
			$this.siblings(".accordion-block").find(".accordion-content").slideUp();
			$this.addClass("active");
			$this.find(".accordion-content").stop(true, true).slideDown();
		}
	});
}

/*equalHeight*/
function eqHeight() {
	$.fn.extend({
		equalHeights: function() {
			var top = 0;
			var row = [];
			var classname = ('equalHeights' + Math.random()).replace('.', '');
			$(this).each(function() {
				var thistop = $(this).offset().top;
				if (thistop > top) {
					$('.' + classname).removeClass(classname);
					top = thistop;
				}
				$(this).addClass(classname);
				$(this).height('auto');
				var h = (Math.max.apply(null, $('.' + classname).map(function() {
					return $(this).height();
				}).get()));
				$('.' + classname).height(h);
			}).removeClass(classname);
		}
	})


	/*setTimeout(function(){
		
	},200);*/
	
	$(".img_text_block .equal_content").equalHeights();
	$(".feature_links ul li").equalHeights();
	$(".eqTeamHeight").equalHeights();
	$(".blog_article_block .blog_article span.title").equalHeights();
	$(".blog_article_block .blog_article span.details").equalHeights();
	$(".img-text-outer .eq-col-block").equalHeights();
	$(".drop-block .eq-drop-block").equalHeights();
	$(".equal-block").equalHeights();
	$(".middle_footer .footer-col-inner").equalHeights();
	$(".patient-info-page .col-content-tab .eq-patient").equalHeights();
}



